import React from "react";
import PropTypes from "prop-types";

const SendSolution = ({
  result,
  taskStatus,
  answers,
  description,
  maxPoints,
  sendSolution,
  resolved,
  error,
  toUpdate,
}) => {
  return (
    <div>
      {resolved ? (
        <>
          {toUpdate ? (
            <>Zadanie wysłano do weryfikacji</>
          ) : (
            <>
              {error.length > 0 && <>{error}</>}
              {result === maxPoints ? (
                <button>Wyslij rozwiązanie</button>
              ) : (
                <>
                  <button>Wyślij do weryfikacji</button>
                  <button>Wyslij rozwiązanie</button>
                </>
              )}
            </>
          )}
        </>
      ) : (
        <></>
      )}
    </div>
  );
};

export default SendSolution;
